  false,\n\t\"url\": null,\n\t\"notes\": \"During June 1989, selected areas of the
  southern Askinuk Mountains were surveyed for raptor nests. Ten nests were located
  on rock outcroppings at seven locations. Four nests were active. Five nesting territories
  were determined to be inactive. The remaining nest was of undetermined status. Only
  a small portion of the Askinuk Mountains was surveyed for raptors and raptors nests.
  In the future a complete survey should be conducted to document all raptor nesting
  sites.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
